function m_new_mtx(rows,cols){

     var A =new Array(rows);                          //列(rows)

      for(var m=0; m<A.length; m++){
          A[m]= new Array(cols); }                     //欄位(columns)

  return A;
}


function m_new_space_mtx(rows,cols){                //"" matrix

     var A =m_new_mtx(rows,cols);                          //列(rows)

       for(var i=0;i<A.length ;i++){  
       for(var j=0;j<A[0].length ;j++){          //A inition
          A[i][j] ="";

                                      }

                                     }
  return A;
}



function m_new_zero_mtx(rows,cols){                    // 0 matrix

     var A =m_new_mtx(rows,cols);                          //列(rows)


     for(var i=0;i<A.length ;i++){  
       for(var j=0;j<A[0].length ;j++){          //A inition
          A[i][j] =0;

                                      }

                                     }
      

  return A;
}

function m_new_unit_mtx(rows,cols){                    // unit matrix

     var A =m_new_mtx(rows,cols);                          //列(rows)


     for(var i=0;i<A.length ;i++){  
       for(var j=0;j<A[0].length ;j++){          //A inition
          A[i][j] =1;

                                      }

                                     }
      

  return A;
}

function m_new_5_unit_mtx(rows,cols){                    // unit matrix

     var A =m_new_zero_mtx(rows,cols);                         //列(rows)

       A[0][0] =100000;

     

 
  return A;
}


function m_mtx_space_end(A){      //  A element data左移  "" to 右移 
  var AA=A;
  
      var data_row = AA.length;   //rows
      var data_col=AA[0].length;  //cols

       
      BB = m_new_space_mtx(data_row,data_col);                //new "" matrix



    for(var i=0;i<data_row ;i++){

       var k=0 ; //初值


     for(var j=0;j<data_col ;j++){

         
        
         var data_element = AA[i][j].toString();

           

           if(data_element !=""){       //data左移    ""右移
             BB[i][k] = data_element;
                  var k=k+1 ;
                                }   //if

               
       
                                }

                                 } 




  return BB;
}


function m_mtx_element_str(A){      //  A element  to str   matrix element轉string  
  var AA=A;
  
      var data_row = AA.length;   //rows
      var data_col=AA[0].length;  //cols

      

      var str_new = "" ;                //inition



    for(var i=0;i<data_row ;i++){

       

     for(var j=0;j<data_col ;j++){

         
        
         var data_element = AA[i][j].toString();

           

           if(data_element !=""){       //data左移    ""右移

               var str_new=str_new+data_element;

                                }   //if

              
       
                                }  //for

                                 }  // for


                var str_new=str_new.trim();  



  return str_new ;
}


function m_mtx_scale(A,x){      //x 乘  A element
  var AA=A;
  var xx=x;
      var data_row = AA.length;   //rows
      var data_col=AA[0].length;  //cols

    for(var i=0;i<data_row ;i++){
     for(var j=0;j<data_col ;j++){
        AA[i][j]=AA[i][j]*xx; 
       
                                }
                                 } 
  return AA;
}


function m_mtx_copy_mtx(A,B){      // A(小) copy  B(大)
  var AA=A;
  var BB=B;

     
      var data_row = AA.length;   //rows
      var data_col=AA[0].length;  //cols
   
    
    for(var i=0;i<data_row ;i++){

     for(var j=0;j<data_col ;j++){

        

             

        AA[i][j]= BB[i][j];   //負值不支援 -5 ,5,5

        
                                }
                                 } 


  return AA;
}



function m_mtx_copy_col_mtx(A,B){      // A(小) copy  B(大)   nubcol第幾個 B col開始 copy
  var AA=A;
  var BB=B;
  

    

      var data_row = AA.length;   //rows
      var data_col=AA[0].length;  //cols

    for(var i=0;i<data_row ;i++){     //nub not copy 
     for(var j=0;j<(data_col-1) ;j++){
        AA[i][j]=BB[i][j+1]; 
       
                                            }
                                 } 

  

       
  return AA;
}





