function m_mtx_point_add_total(x,y){     // x<0  y<0   彙整 多位數小數 相加
  var A=m_new_zero_mtx(1,MTX_COL);            // new 0 mtx
  var B=m_new_zero_mtx(1,MTX_COL);            // new 0 mtx
  var C=m_new_zero_mtx(1,MTX_COL);            // new 0 mtx     C=A+B
      A=m_mtx_point_in(A,x);             //x in A 


      B=m_mtx_point_in(B,y);             //y in B 

         for(var i=0;i<C[0].length ;i++){  
              if(x<0){ A[0][i]=A[0][i]*(-1);}    //x 負值
              if(y<0){ B[0][i]=B[0][i]*(-1);}    //y 負值
             
                      }

    var C = m_mtx_point_add(A,B);

  return CC;
}




function m_mtx_point_add(A,B){        //  A x element + B y element

    var AA=A;
    var BB=B; 



    AA= m_mtx_cell_five_brow(AA);        // 借位  小數
    AA= m_mtx_cell_five(AA);             // AA element  最大5位 小數  差
    BB= m_mtx_cell_five_brow(BB);         // 借位  小數
    BB= m_mtx_cell_five(BB);               //  BB element  最大5位 小數  差 

   var aa=AA[0][0].toString().trim();
   var bb=BB[0][0].toString().trim();

   
   var data_chk_a = aa.substr(0,1);
   var data_chk_b = bb.substr(0,1);



   if(data_chk_a =="-"){ 
         var aaa=aa.substr(1,aa.length-1);

        AA[0][0]= aaa ;   //負轉正
         
         } 


   if(data_chk_b =="-"){ 
        var bbb=bb.substr(1,bb.length-1);
          
       BB[0][0]= bbb ;   //負轉正
       
         }  


    var CC=m_new_zero_mtx(AA.length,AA[0].length);            // new 0 mtx     C=A+B

    if(data_chk_a =="-" && data_chk_b !="-"){                      // - +
         CC= m_mtx_point_sub(BB,AA); 
         CC = m_mtx_cell_five_brow(CC); //借位
         CC= m_mtx_cell_five(CC);               //  BB element  最大5位 小數  差 
                                        }            //20180106



    else if(data_chk_a !="-" && data_chk_b =="-"){                //+ -
         CC= m_mtx_point_sub(AA,BB);
         CC = m_mtx_cell_five_brow(CC); //借位 
         CC= m_mtx_cell_five(CC);
                                      }
    else{                                                    //++ --
        for(var n=0;n<CC[0].length ;n++){    //c=a+b 
              var data_a = parseInt(AA[0][n]);
              var data_b = parseInt(BB[0][n]);
             
                   CC[0][n]= data_a + data_b;
                                                               
                                  }



                CC= m_mtx_cell_five(CC);               //  BB element  最大5位 小數  差 




                 if(data_chk_a =="-" && data_chk_b =="-"){
                     CC[0][0]= "-"+CC[0][0].toString() ;  }  //正轉負
   
            }

                     
   
  return CC;
}




